/**
 * Created by weiyun on 2019/10/23.
 */
import React ,{Component} from 'react'

class clock extends Component {
    render(){
        let {
            onWeakUp,
            onSleep,
            time
        }=this.props;

        if(time ===9){
            onWeakUp();
        }
        if(time ===21){
            onSleep();
        }
        return(
            <div>
                clock
            </div>
        )
    }
}


class App extends Component{
    render(){
        return(
            <div>
                <clock
                    time = {12}
                    onWeakUp={()=>{
                        alert('weak up');
                    }}
                    onSleep={()=>{
                        alert('sleep');
                    }}

                />
            </div>
        )
    }


}

export default App;
